import React from 'react'
import './Footer.css'
import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";
import { Link } from 'react-router-dom'
import Logo from "../../assets/images/Logo.png";

const QuickLinks = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "/tours",
    display: "Tours",
  },
];

const QuickLinks2 = [
  {
    path: "/Gallery",
    display: "Gallery",
  },
  {
    path: "/Login",
    display: "Login",
  },
  {
    path: "/Register",
    display: "Register",
  },
];

const Footer = () => {
  return (
    <footer className='footer'>
      <Container>
        <Row>
          <Col lg='3'>
            <div className="logo">
              <img src={Logo} />
            </div>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
